	Function Set-DarkMode
	{
		$formChangelog.ForeColor = 'White'
		$formChangelog.BackColor = "44,44,44"
		
		$textboxchangelog.ForeColor = 'White'
		$textboxchangelog.BackColor = "44,44,44"
		
		$buttonOkay.BackColor = "35,35,35"
		$buttonOkay.ForeColor = 'White'
	}
	
	function Set-LightMode
	{
		$formChangelog.ForeColor = 'Black'
		$formChangelog.BackColor = "WhiteSmoke"
		
		$textboxchangelog.ForeColor = 'Black'
		$textboxchangelog.BackColor = "WhiteSmoke"
		
		$buttonOkay.BackColor = "WhiteSmoke"
		$buttonOkay.ForeColor = 'Black'
	}
	$formChangelog_Load = {
		$DarkMode = (Get-ItemProperty 'HKCU:\Software\TheLazyAdministrator\MasterUserCreator\' | Get-ItemProperty -Name DarkMode -ErrorAction SilentlyContinue).DarkMode
		If ($DarkMode -eq 1)
		{
			Set-DarkMode
			
		}
		Else
		{
			Set-LightMode
			
		}
		
		$textboxchangelog.Text =
		"v2.0.0
ADDED:
- DARK MODE :D
- Variable Based User formatting
	EX: Automatically have the display name formatted Lastname, Firstname in options by setting '%LastName%, %FirstName'
	EX: Add Employee Number before UPN in options by setting '%EmployeeNumber% - %FirstName% %LastName%
- Copy attributes from a current Active Directory user
- If trying to copy AD attributes from a current AD User and AD module is not found it will error and close that form
- Friendly warning if no AD Users were returned
- Configurable Title Case for Active Directory attributes
- Configurable TItle Case for Office 365 attributes
- Added Options menu to configure application specific options
- Registry string shown to users where options are stored
- Added dictionary based passwords 
- Password options for pronounceable password or random character password
- Added option to reset form after user creation
- Reset form changed to PS Function
- Ability to live filter and unfilter AD groups!
- Ability to live filter and unfilter O365 Mail groups!
- Ability to live filter and unfilter O365 Security groups!
- Added employeeType attribute for new AD Users
- Added employeeNumber attribute for new AD Users

CHANGED:
- If trying to create an Active Directory user and ActiveDirectory module is not present it will stop and error as well as uncheck create an AD user checkbox
- Changed how it will try and find ADSync module, improving performance 
- Moved load events to show events to improve application performance
- Changelog textbox is read only

FIXED: 
- Scaling issues with high DPI diplays

v1.0.5
FIXED:
- MFA login not finding the EXOSession module
- Fixed Shared Mailbox AutoMapping not applying


v1.0.4
ADDED:
- Set AD Users Priamary Group
- Primary Group combobox items will be Domain Users + selected AD Groups
- Primary Groups by default will be Domain Users


v1.0.3
ADDED:
- ADSync Server Text box enable state toggles with the ADSync checkbox
- External log file will default to '$env:TEMP\MUC.txt'
- If canceling out of setting external log file path, path will not default to null

CHANGED:
- Changed ADSync text


v1.0.2
ADDED:
- Set an Active Directory account to expire
- DatePicker and TimePicker
- Label below DateTimePicker will do DateMath to figure out how many days, hours, and minutes until the account will expire
- DatePicker uses a month grid view

FIXED:
- Fixed tab order in Office 365 user on Account Page


v1.0.1
ADDED:
- Option to enter your DirSync server to invoke an ADSync
- Changelog form
- Added the following SKUs:
	'EOP_ENTERPRISE_STUDENT' = 'Exchange Online Protection for Students'
	'EXCHANGEENTERPRISE_FACULTY' = 'Microsoft Office 365 Exchange Online (Plan 2) only for Faculty'
	'OFFICESUBSCRIPTION_FACULTY' = 'Office 365 ProPlus Faculty Benefit'
	'POWERAPPS_VIRAL' = 'Microsoft Power Apps & Flow'
	'AX7_USER_TRIAL' = 'Microsoft Dynamics AX7 User Trial'
	'CRM_HYBRIDCONNECTOR' = 'CRM_HYBRIDCONNECTOR'
	'DESKLESS' = 'Microsoft StaffHub'
	'EOP_ENTERPRISE' = 'Exchange Online Protection'
	'GLOBAL_SERVICE_MONITOR' = 'Global Service Monitor Online Service'
	'POWERAPPS_INDIVIDUAL_USER' = 'Microsoft PowerApps and Logic flows'
	'EOP_ENTERPRISE_FACULTY' = 'Exchange Online Protection for Faculty'
	'STREAM' = 'Microsoft Stream'
- External Log File: Have your logs be continuously saved to an external file
- Status page on Settings form, display connection to Office 365, external log location
- Display warning if EXO MFA Module is not found but MFA login set to enabled

CHANGED:
- Changed 'Run DirSync After User Creation' to 'Run ADSync After User creation'
- UI color changed to WhiteSmoke for a more modern look
- Disabled FullScreen option
- All Forms autoscale to DPI, AutoSize and AutoSize set to Grow and Shrink

FIXED:
- Fixed issue where creating an AD User and running an AD Sync would not enable user creation button (pre-reqs)
- Mailbox creation loop will exit 8 minutes after it began

REMOVED:
- Removed objects that were being disabled depending on DirSync option that are no longer present
"
		
	}
	
