	$Form_StateCorrection_Load=
	{
		#Correct the initial state of the form to prevent the .Net maximized form issue
		$formChangelog.WindowState = $InitialFormWindowState
	}
	
	$Form_StoreValues_Closing=
	{
		#Store the control values
		$script:ChangeLog_textboxchangelog = $textboxchangelog.Text
	}

	
	$Form_Cleanup_FormClosed=
	{
		#Remove all event handlers from the controls
		try
		{
			$formChangelog.remove_Load($formChangelog_Load)
			$formChangelog.remove_Load($Form_StateCorrection_Load)
			$formChangelog.remove_Closing($Form_StoreValues_Closing)
			$formChangelog.remove_FormClosed($Form_Cleanup_FormClosed)
		}
		catch { Out-Null <# Prevent PSScriptAnalyzer warning #> }
	}
	#endregion Generated Events

