	#region Control Helper Functions
	function Update-ComboBox
	{
	<#
		.SYNOPSIS
			This functions helps you load items into a ComboBox.
		
		.DESCRIPTION
			Use this function to dynamically load items into the ComboBox control.
		
		.PARAMETER ComboBox
			The ComboBox control you want to add items to.
		
		.PARAMETER Items
			The object or objects you wish to load into the ComboBox's Items collection.
		
		.PARAMETER DisplayMember
			Indicates the property to display for the items in this control.
			
		.PARAMETER ValueMember
			Indicates the property to use for the value of the control.
		
		.PARAMETER Append
			Adds the item(s) to the ComboBox without clearing the Items collection.
		
		.EXAMPLE
			Update-ComboBox $combobox1 "Red", "White", "Blue"
		
		.EXAMPLE
			Update-ComboBox $combobox1 "Red" -Append
			Update-ComboBox $combobox1 "White" -Append
			Update-ComboBox $combobox1 "Blue" -Append
		
		.EXAMPLE
			Update-ComboBox $combobox1 (Get-Process) "ProcessName"
		
		.NOTES
			Additional information about the function.
	#>
		
		param
		(
			[Parameter(Mandatory = $true)]
			[ValidateNotNull()]
			[System.Windows.Forms.ComboBox]$ComboBox,
			[Parameter(Mandatory = $true)]
			[ValidateNotNull()]
			$Items,
			[Parameter(Mandatory = $false)]
			[string]$DisplayMember,
			[Parameter(Mandatory = $false)]
			[string]$ValueMember,
			[switch]$Append
		)
		
		if (-not $Append)
		{
			$ComboBox.Items.Clear()
		}
		
		if ($Items -is [Object[]])
		{
			$ComboBox.Items.AddRange($Items)
		}
		elseif ($Items -is [System.Collections.IEnumerable])
		{
			$ComboBox.BeginUpdate()
			foreach ($obj in $Items)
			{
				$ComboBox.Items.Add($obj)
			}
			$ComboBox.EndUpdate()
		}
		else
		{
			$ComboBox.Items.Add($Items)
		}
		
		$ComboBox.DisplayMember = $DisplayMember
		$ComboBox.ValueMember = $ValueMember
	}
	#endregion
	
	$formCopyActiveDirectoryU_Load = {
		$toolstripstatuslabel1.Text = "Status: Finding ActiveDirectory Module"
		If ($Null -ne (Get-Module -ListAvailable -Name "ActiveDirectory"))
		{
			$toolstripstatuslabel1.Text = "Status: Module is present"
			
			$toolstripstatuslabel1.Text = "Status: Checking PSJobs"
			
			
			If ($null -eq (Get-Job -Name "GetUsers" -ErrorAction SilentlyContinue))
			{
				$toolstripstatuslabel1.Text = "Status: Creating PSJob"
				
				Start-Job -Name "GetUsers" -ScriptBlock { (Get-ADUser -Filter *).Name }
				
				$toolstripstatuslabel1.Text = "Status: Getting all Active Directory Users"
				
			}
		}
		Else
		{
			$toolstripstatuslabel1.Text = "Status: ActiveDirectory Module is not present"
			
			$InfoMessage = "The ActiveDirectory module on $Env:COMPUTERNAME was not found"
			$InfoTitle = "Error"
			Show-MessageBox_psf
			$formCopyActiveDirectoryU.Close()
		}
		If ((Get-Job -Name 'GetUsers').State -eq "Completed")
		{
			$toolstripstatuslabel1.Text = "Status: Loaded all Active Directory Users"
			
			$comboboxcopyuser.Text = ""
			$Users = Receive-Job -Name "GetUsers"
			Update-ComboBox -ComboBox $comboboxcopyuser -Items $Users
		}
		
	}
	
	
	
	
	$buttonOK_Click={
		If ($comboboxcopyuser.SelectedItem -ne $Null)
		{
			$toolstripstatuslabel1.Text = "Status: Selected User is $($comboboxcopyuser.SelectedItem) "
			
			$CopyUserName = $comboboxcopyuser.SelectedItem
			$formCopyActiveDirectoryU.Close()
		}
		Else
		{
			$toolstripstatuslabel1.Text = "Status: Selected User is $($comboboxcopyuser.SelectedItem) "
			
			$InfoMessage = "No Active Directory user has been selected"
			$InfoTitle = "Error"
			Show-MessageBox_psf
		}
		
	}
	
	$comboboxcopyuser_Click = {
		
			$toolstripstatuslabel1.Text = "Status: Selected User is $($comboboxcopyuser.SelectedItem) "
			
			
		
		
	}
	$formCopyActiveDirectoryU__Shown = {
		
		
		If ((Get-Job -Name 'GetUsers').State -ne "Completed")
		{
			Do
			{
				$toolstripstatuslabel1.Text = "Status: Gathering all users, please wait."
				Start-Sleep -Seconds 1
				$toolstripstatuslabel1.Text = "Status: Gathering all users, please wait.."
				Start-Sleep -Seconds 1
				$toolstripstatuslabel1.Text = "Status: Gathering all users, please wait..."
				Start-Sleep -Seconds 1
			}
			Until ((Get-Job -Name 'GetUsers').State -eq "Completed")
			$toolstripstatuslabel1.Text = "Status: Completed"
			
			$Users = Receive-Job -Name "GetUsers" | Sort-Object
			If ($null -ne $Users)
			{
				$comboboxcopyuser.Text = ""
				$toolstripstatuslabel1.Text = "Status: Please select a user"
				
				Update-ComboBox -ComboBox $comboboxcopyuser -Items $Users
			}
			Else
			{
				$toolstripstatuslabel1.Text = "Status: No users were found"
				
				$comboboxcopyuser.Text = ""
				$comboboxcopyuser.Text = "NO USER OBJECTS WERE RETURNED"
			}
		}
	}
	
	$formCopyActiveDirectoryU__FormClosing = {
		Get-Job | Remove-Job
	}
	
